import co.edu.uniandes.csw.paseos.dtos.FotoDTO;
import co.edu.uniandes.csw.paseos.dtos.PaseoDetailDTO;
import co.edu.uniandes.csw.paseos.entities.FotoEntity;
import co.edu.uniandes.csw.paseos.entities.PaseoEntity;
import static org.junit.Assert.assertEquals;
import org.junit.Test;
import uk.co.jemos.podam.api.PodamFactory;
import uk.co.jemos.podam.api.PodamFactoryImpl;

/**
 *
 * @author Venegas
 */

public class FotoDTOTest {

   
    @Test
    public void entityDtoentity() {
        PodamFactory factory = new PodamFactoryImpl();
        FotoEntity foto = factory.manufacturePojo(FotoEntity.class);
        foto.setId(new Long(0));
        foto.setFormato("jpeg");
        foto.setValor("".getBytes());
        
        FotoDTO paseoDto = new FotoDTO(foto);
        FotoEntity entity = paseoDto.toEntity();
        assertEquals(foto.getFormato(), entity.getFormato());
        assertEquals(new String(foto.getValor()), new String(entity.getValor()));
        assertEquals(foto.getId(), entity.getId());
        
    }

    @Test
    public void DtoEntityDto() {
        PodamFactory factory = new PodamFactoryImpl();
        FotoDTO foto = factory.manufacturePojo(FotoDTO.class);
        foto.setValor("data:image/jpeg;base64,");
        FotoEntity fotoE = foto.toEntity();
        FotoDTO entity = new FotoDTO(fotoE);
        
        assertEquals(foto.getId(), entity.getId());
        assertEquals(foto.getValor(), entity.getValor());
        
    }
}
